import React from "react";
import {
  TextField,
  Button,
  Typography,
  Link,
  Grid,
  Box,
  Paper,
} from "@mui/material";
import {
  Google as GoogleIcon,
  Facebook as FacebookIcon,
  Person as PersonIcon,
  Lock as LockIcon,
} from "@mui/icons-material";
import { styled } from "@mui/system";
import { ThemeProvider, createTheme } from "@mui/material/styles";
import CssBaseline from "@mui/material/CssBaseline";

// Importing Poppins font
import "@fontsource/poppins/400.css";

// Importing Roboto font
import "@fontsource/roboto/300.css";
import "@fontsource/roboto/400.css";
import "@fontsource/roboto/500.css";
import "@fontsource/roboto/700.css";

import barbellIcon from "../Images/Login/23603572.png";
import bulkyManImage from "../Images/Login/Bulky_man.png"; // Corrected to PNG

// Create a theme to use Roboto globally
const theme = createTheme({
  typography: {
    fontFamily: "Roboto, Arial, sans-serif",
  },
});

const BackgroundBox = styled(Box)({
  display: "flex",
  justifyContent: "center",
  alignItems: "center",
  height: "100vh",
  backgroundColor: "#f5f5f5",
});

// Updated FormBox with specified width and height
const FormBox = styled(Paper)(({ theme }) => ({
  padding: theme.spacing(4), // Use theme spacing for padding
  display: "flex",
  flexDirection: "column",
  alignItems: "center",
  width: "683px", // Fixed width
  height: "768px", // Fixed height
  boxShadow: "0px 4px 20px rgba(0, 0, 0, 0.1)",
  borderBottomLeftRadius: "12px",
  borderTopLeftRadius: "12px",
  textAlign: "center",
}));

const InputBox = styled(Box)({
  display: "flex",
  alignItems: "center",
  justifyContent: "center", // Centers icon and text field horizontally
  backgroundColor: "#d8e9e9", // Updated background color
  borderRadius: "15px", // Updated border radius
  width: "364px", // Updated width
  height: "52px", // Updated height
  marginBottom: "16px",
  padding: "0 10px", // Add padding to give some space inside the box
});

const StyledTextField = styled(TextField)({
  flex: 1,
  "& .MuiInputBase-root": {
    height: "100%", // Ensure the input fills the height of the container
    display: "flex",
    alignItems: "center", // Center vertically
    padding: 0, // Remove default padding
    backgroundColor: "transparent", // Make it transparent to see the full box
  },
  "& .MuiInputBase-input": {
    padding: 0, // Ensure no padding affects centering
    textAlign: "center", // Center text horizontally
    height: "100%", // Fill container height
    lineHeight: "52px", // Match container height for centering
    fontSize: "16px", // Ensure consistent font size
  },
  "& .MuiFormLabel-root": {
    textAlign: "center", // Center the label text
    width: "100%",
    transform: "translateY(16px)", // Adjust label position when focused
  },
  "& fieldset": {
    border: "none", // Remove border for seamless look
  },
});

const IconWrapper = styled(Box)({
  padding: "8px",
  display: "flex",
  alignItems: "center", // Center icon vertically
});

const LoginButton = styled(Button)({
  width: "124px", // Specified width
  height: "52px", // Specified height
  backgroundColor: "#94C1C6", // Specified color
  color: "#fff", // Text color
  borderRadius: "16px", // Specified border radius
  marginTop: "24px", // Ensure spacing from previous element
  marginBottom: "24px", // Space below
  "&:hover": {
    backgroundColor: "#82B2B6", // Slightly darker color on hover
  },
});

const Login = () => {
  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <BackgroundBox>
        <Box
          sx={{
            display: "flex",
            flexDirection: { xs: "column", md: "row" },
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <FormBox>
            <Typography
              component="h1"
              sx={{
                mt: 2,
                fontFamily: "Poppins, Arial, sans-serif",
                fontSize: "16px",
                fontWeight: 400, // Regular weight for Poppins
                paddingBottom: "5px", // Add padding below
              }}
            >
              Login and start bulking right now!
            </Typography>
            <img src={barbellIcon} alt="Barbell Icon" width="320" height="112" />
            <Box
              component="form"
              noValidate
              sx={{
                mt: 2,
                width: "100%",
                display: "flex",
                flexDirection: "column",
                alignItems: "center", // Center the form elements
              }}
            >
              <InputBox>
                <IconWrapper>
                  <PersonIcon />
                </IconWrapper>
                <StyledTextField
                  margin="normal"
                  required
                  fullWidth
                  id="username"
                  label="Username"
                  name="username"
                  autoComplete="username"
                  autoFocus
                  variant="outlined"
                  InputLabelProps={{
                    shrink: true, // Ensure label stays above the input
                  }}
                />
              </InputBox>
              <InputBox>
                <IconWrapper>
                  <LockIcon />
                </IconWrapper>
                <StyledTextField
                  margin="normal"
                  required
                  fullWidth
                  name="password"
                  label="Password"
                  type="password"
                  id="password"
                  autoComplete="current-password"
                  variant="outlined"
                  InputLabelProps={{
                    shrink: true, // Ensure label stays above the input
                  }}
                />
              </InputBox>
              <Link href="#" variant="body2" sx={{ alignSelf: "flex-start", mb: 2 }}>
                Forgot your password?
              </Link>
              <LoginButton type="submit" variant="contained">
                Login
              </LoginButton>
              <Typography variant="body1" align="center" sx={{ mt: 2 }}>
                Login with Others
              </Typography>
              <Grid container spacing={2} sx={{ mt: 1 }}>
                <Grid item xs={12}>
                  <Button
                    fullWidth
                    variant="contained"
                    startIcon={<GoogleIcon />}
                    sx={{ backgroundColor: "#db4a39", color: "#fff", mb: 1 }}
                  >
                    Login with Google
                  </Button>
                </Grid>
                <Grid item xs={12}>
                  <Button
                    fullWidth
                    variant="contained"
                    startIcon={<FacebookIcon />}
                    sx={{ backgroundColor: "#3b5998", color: "#fff" }}
                  >
                    Login with Facebook
                  </Button>
                </Grid>
              </Grid>
              <Typography variant="body2" align="center" sx={{ mt: 2 }}>
                Not a member? <Link href="#">Register now</Link>
              </Typography>
            </Box>
          </FormBox>
          <Box
            sx={{
              display: { xs: "none", md: "flex" },
              justifyContent: "center",
              alignItems: "center",
              width: "683px",
              height: "768px",
              backgroundColor: "#d4d0ca", // Updated background color
              borderTopRightRadius: "12px",
              borderBottomRightRadius: "12px",
              overflow: "hidden",
            }}
          >
            <img
              src={bulkyManImage}
              alt="Fitness"
              style={{
                width: "683px",
                height: "683px",
                borderRadius: "12px",
              }}
            />
          </Box>
        </Box>
      </BackgroundBox>
    </ThemeProvider>
  );
};

export default Login;
